import React, { Component } from "react";
import { Switch, Route, BrowserRouter } from "react-router-dom";

import RulesIngestion from "./rules-ingestion";
import Navbar from "../../common/navbar";
import "./extractionContainer.scss";

class ExtractionContainer extends Component {
  state = {
    tabs: [
      {
        _id: 1,
        title: "dashboard",
        path: "/dashboard",
      },
      {
        _id: 2,
        title: "ingestion",
        path: "/ingestion",
      },
      {
        _id: 3,
        title: "configuration",
        path: "/configuration",
      },
      {
        _id: 4,
        title: "execution",
        path: "/execution",
      },
      {
        _id: 5,
        title: "views",
        path: "/views",
      },
    ],
  };

  render() {
    return (
      <div className="extraction-container">
        <div className="header">
          <Navbar tabs={this.state.tabs} />
        </div>
        <div className="rules-container">
          <h4>asdalskdaklsdlaksdm</h4>
          <Route
            component={({ match }) => (
              <div>
                <Route path="/ingestion" component={RulesIngestion} />
                {/* <Route path='/page2' component={Page2} />
        <Route path='/page3' component={Page3} /> */}
              </div>
            )}
          />
          {/* <BrowserRouter>
            <Switch>
              <Route path="/ingestion" exact component={RulesIngestion} />
            </Switch>
          </BrowserRouter> */}
        </div>
      </div>
    );
  }
}

export default ExtractionContainer;
